INSERT INTO `el_qu` VALUES ('1900611946424610817',1,0,'','以下哪种方法是缓解焦虑的常见方式？','2025-03-15 02:16:14','2025-03-15 02:16:14','','答案：B. 进行体育锻炼\n解析：体育锻炼能够促进内啡肽的分泌，帮助缓解焦虑情绪。\n参考网址：WebMD https://www.webmd.com/anxiety-panic/guide/exercise-anxiety','default'),('1900612518401847297',1,1,'','认知行为疗法（CBT）在焦虑管理中常用哪些技术？','2025-03-15 02:18:30','2025-03-15 02:18:30','','答案：D. 以上都是\n解析：认知行为疗法通过多种技术帮助个体识别和改变负面思维模式。\n参考网址：美国心理协会 https://www.apa.org/pi/sms/resources/cognitive-behavioral','default'),('1900612740834177025',3,2,'','广泛性焦虑障碍（GAD）与正常焦虑的区别在于症状的严重程度和持续时间。','2025-03-15 02:19:23','2025-03-15 02:19:23','','答案：正确\n解析：广泛性焦虑障碍的症状通常更为持久和严重，显著影响日常生活。\n参考网址：NIMH  https://www.nimh.nih.gov/health/topics/anxiety-disorders','default'),('1900612967838298113',3,0,'','长期压力可能导致头痛、失眠和免疫力下降。','2025-03-15 02:20:17','2025-03-15 02:20:17','','答案：正确\n解析：长期压力会引发身体和心理的多种负面影响。\n参考网址：梅奥诊所 https://www.mayoclinic.org/healthy-lifestyle/stress-management/in-depth/stress-symptoms/art-20050987','default'),('1900613336861552642',1,1,'','以下哪种方法有助于调节压力？','2025-03-15 02:21:45','2025-03-15 02:21:45','','答案：B. 有效的时间管理\n解析：\n','default'),('1900613647500095489',2,2,'','皮质醇（cortisol）在长期压力下可能对身体造成哪些影响？','2025-03-15 02:22:59','2025-03-15 02:22:59','','答案：A. 血压升高，B. 免疫系统抑制\n解析：高水平的皮质醇与多种身体健康问题相关。\n参考网址：WebMD https://www.webmd.com/hypertension-high-blood-pressure/guide/cortisol-stress-hormone','default'),('1900613934084304898',2,0,'','以下哪些是健康的情绪表达方式？','2025-03-15 02:24:08','2025-03-15 02:24:08','','答案：A. 向朋友倾诉，C. 通过写作记录感受\n解析：健康的情绪表达需要适当的宣泄和社交支持。\n参考网址：Psychology Today  https://www.psychologytoday.com/us/basics/emotional-intelligence','default'),('1900614100585590785',3,1,'','长期压抑情绪可能导致焦虑或抑郁等心理问题。','2025-03-15 02:24:47','2025-03-15 02:24:47','','答案：正确\n解析：情绪压抑可能引发心理和生理健康问题。\n参考网址：American Psychological Association','default'),('1900614373580255233',1,2,'','正念减压疗法（MBSR）的核心要素是什么？','2025-03-15 02:25:53','2025-03-15 02:25:53','','答案：B. 注重身体感受与正念冥想\n解析：MBSR由卡巴金博士开发，结合正念冥想和身体觉察。\n参考网址：UMASS Medical School  https://umassmed.edu/mindfulness-programs/mbsr/','default'),('1900614686190120961',3,0,'','保持良好的社交支持网络有助于预防心理疾病。','2025-03-15 02:27:07','2025-03-15 02:27:07','','答案：正确\n解析：社交支持是心理健康的重要保护因素。\n参考网址：世界卫生组织 https://www.who.int/mental_health/mh_gard_guidelines.pdf','default'),('1900614984363192321',1,1,'','为什么早期干预在心理疾病预防中非常重要？','2025-03-15 02:28:18','2025-03-15 02:28:18','','答案：B. 可以减少疾病对生活的负面影响\n解析：早期干预有助于改善预后，减少疾病带来的长期影响。\n参考网址：NAMI https://www.nami.org/About-Mental-Illness/Treatments-Psychiatric-Medications','default'),('1900615316413657090',2,2,'','以下哪些因素可能与抑郁症的预防有关？','2025-03-15 02:29:37','2025-03-15 02:29:37','','答案：A. 保持规律的运动，B. 均衡饮食，包括Omega-3脂肪酸，D. 良好的睡眠卫生\n解析：生活方式的调整对预防抑郁症有积极作用。\n参考网址：Harvard Health Publishing https://www.health.harvard.edu/mind-and-mood/diet-and-depression','default'),('1927003677095358465',1,0,'','在《思考，快与慢》中，系统1的特点是快速且自动的反应，这种反应有时会导致焦虑情绪的产生。以下哪种情况最可能触发系统1的焦虑反应？','2025-05-26 22:07:33','2025-05-26 22:07:33','','系统 1 的核心特征是 “自动化、快速响应”，其焦虑反应多由突发的、本能可感知的威胁（如巨响、危险画面）触发；而系统 2 主导的活动（如深思、规划、阅读）因需要理性思考，通常不会直接激活系统 1 的焦虑机制。\n','default');
