INSERT INTO `el_qu_answer` VALUES ('1537604563895336961','1537604562603491329',1,'','正确',''),('1537604563895336962','1537604562603491329',0,'','错误',''),('1537604677279956993','1537604675832922113',1,'','正确',''),('1537604677288345602','1537604675832922113',0,'','错误',''),('1900611946781126658','1900611946424610817',0,'','避免社交',''),('1900611946806292481','1900611946424610817',1,'','进行体育锻炼',''),('1900611946806292482','1900611946424610817',0,'','增加咖啡因摄入',''),('1900611946806292483','1900611946424610817',0,'','睡眠不足',''),('1900612518930329601','1900612518401847297',0,'','思考挑战',''),('1900612518930329602','1900612518401847297',0,'','行为实验',''),('1900612518930329603','1900612518401847297',0,'','放松训练',''),('1900612518930329604','1900612518401847297',1,'','以上都是',''),('1900612740897091586','1900612740834177025',1,'','正确',''),('1900612740964200450','1900612740834177025',0,'','错误',''),('1900612967897018369','1900612967838298113',1,'','正确',''),('1900612967897018370','1900612967838298113',0,'','错误',''),('1900613336928661506','1900613336861552642',0,'','拖延重要任务',''),('1900613336991576065','1900613336861552642',1,'','有效的时间管理','解析：合理安排时间可以减少压力源，提升控制感。\n参考网址：HelpGuide https://www.helpguide.org/articles/stress/time-management.htm'),('1900613336991576066','1900613336861552642',0,'','酗酒',''),('1900613336991576067','1900613336861552642',0,'','隔绝社交',''),('1900613647563010050','1900613647500095489',1,'','血压升高\n ',''),('1900613647563010051','1900613647500095489',1,'','免疫系统抑制',''),('1900613647563010052','1900613647500095489',0,'','记忆力增强',''),('1900613647563010053','1900613647500095489',0,'','睡眠改善',''),('1900613934084304899','1900613934084304898',1,'','向朋友倾诉',''),('1900613934084304900','1900613934084304898',0,'','一个人默默忍受',''),('1900613934084304901','1900613934084304898',1,'','通过写作记录感受',''),('1900613934084304902','1900613934084304898',0,'','以上都是',''),('1900614100585590786','1900614100585590785',1,'','正确',''),('1900614100585590787','1900614100585590785',0,'','错误',''),('1900614373643169793','1900614373580255233',0,'','分析过去经历',''),('1900614373643169794','1900614373580255233',1,'','注重身体感受与正念冥想',''),('1900614373643169795','1900614373580255233',0,'','设定未来目标',''),('1900614373643169796','1900614373580255233',0,'','避免情绪表达',''),('1900614686387253249','1900614686190120961',1,'','正确',''),('1900614686387253250','1900614686190120961',0,'','错误',''),('1900614984363192322','1900614984363192321',0,'','可以完全治愈所有心理疾病',''),('1900614984363192323','1900614984363192321',1,'','可以减少疾病对生活的负面影响',''),('1900614984363192324','1900614984363192321',0,'','可以避免所有药物治疗',''),('1900614984363192325','1900614984363192321',0,'','可以提高治疗成本',''),('1900615316480765954','1900615316413657090',1,'','保持规律的运动',''),('1900615316480765955','1900615316413657090',1,'','均衡饮食，包括Omega-3脂肪酸',''),('1900615316480765956','1900615316413657090',0,'','避免社交活动',''),('1900615316480765957','1900615316413657090',1,'','良好的睡眠卫生',''),('1927003677552537601','1927003677095358465',0,'','深思熟虑后的决策','解析：深思熟虑的决策属于系统 2 的运作模式。系统 2 的特点是缓慢、理性且需要主动思考，其过程涉及逻辑分析和理性判断，不易触发快速、自动的焦虑反应。因此，该选项与系统 1 的焦虑触发机制无关。'),('1927003677619646465','1927003677095358465',1,'','突然听到巨响','B. 突然听到巨响（正确答案）\n解析：突然的巨响属于无需刻意思考的外界刺激，会直接激活系统 1 的快速反应机制。系统 1 的本能反应会将其视为潜在威胁（如危险信号），从而迅速触发焦虑或恐惧情绪，这是人类进化中形成的自我保护机制。这种反应无需意识控制，符合系统 1“自动、快速” 的特征。'),('1927003677619646466','1927003677095358465',0,'','有条不紊地解决问题','C. 有条不紊地解决问题\n解析：有条不紊地解决问题需要按步骤规划和逻辑推理，依赖系统 2 的主动参与。系统 2 在运作时更注重理性分析，而非本能反应，因此这种情况不易引发系统 1 主导的焦虑情绪。'),('1927003677619646467','1927003677095358465',0,'','阅读一本轻松的书','解析：阅读轻松的书籍通常属于低压力、沉浸式的认知活动，需要系统 2 的注意力投入（如理解文字、构建画面）。此类活动会激活大脑的放松模式，反而可能缓解焦虑，与系统 1 的焦虑触发机制无关。');
